def get_graphene_cell(basis):
    c = Cell()
    c.atom = """
    C  0.006256  1.440599  1.889284
    C  1.213533  0.746080  1.889284
    C -1.197744  3.627599  1.889284
    C  0.009533  2.933080  1.889284
    C  2.430256  1.440599  1.889284
    C  3.637533  0.746080  1.889284
    C  1.226256  3.627599  1.889284
    C  2.433533  2.933080  1.889284
    """
    c.a = array([[4.848, 0.0, 0.0], [-2.408, 4.364, 0.0], [0.0, 0.0, 20.0]])
    c.unit = "Angstrom"
    c.basis = basis
    c.build()
    return c


